 @anonymcomm9653  I obviously know how to spell thought. You evidently don’t know the difference between your and you’re. Typos happen. Butchering grammar as simple as your and you’re shouldn’t happen after primary school.

In formal documents, footnotes are denoted numerically. That way, if there are multiple footnotes on a page, you can distinguish which footnote relates to which word/sentence with ease. The alternative is to stack asterisks (as would be how your suggestion functions), where the number of asterisks in the main text corresponds with the same number of asterisks in the footnotes. That becomes comical very quickly and is therefore scarcely used in any respectable setting. If you’d ever read academic works, or drafted legal papers, you’d know that. 

In any case, there are no typographical corrections in formal documents. Using asterisks for such corrections is an informal construct that only exists within electronic social communication systems, and there is no objective standard/rule. Why can’t Americans just Google stuff before being so passionately wrong. It would help you beat the stereotypes 😂

 @anonymcomm9653  no one is proofreading their YouTube comments my guy, and apparently you are no exception, given you've just typed "its not the deep". Typos happen, and I know you'd get it right if you typed it again. 

However, given you made the exact same grammatical error again with "your" instead of "you're", it's quite clear that you simply don't have a functioning grasp of basic grammar. Hopefully that clarifies the difference for you.

Also, in future, if you make a statement of fact like "it's an objective rule that the asterisk goes before the correction", don't be upset and call someone sensitive for correcting you. In countries where being intelligent is normal, we expect to be corrected for being wrong and we appreciate that the other person took time to fill the gap in our knowledge. Learn some manners, express your gratitude, and move on.

